import React from "react";
import UsersList from "../UsersList";
import { getUser } from "../../data/data";

const users = [getUser("1"), getUser("2"), getUser("3"), getUser("4")];

const SuggestionPanel = (props) => {
  return (
    <div className="suggestion-panel">
      <div className="suggestion-panel-header">You may know</div>
      <UsersList
        users={users}
        setMainContainer={props.setMainContainer}
        more={<More />}
      />
    </div>
  );
};

const More = (props) => {
  {
    return (
      <div className="suggestion-panel-more">
        <div className="suggestion-panel-more-text">
          <span>See all</span>
          <span>{props.users.length}</span>
          <span>suggestions</span>
        </div>
      </div>
    );
  }
};

export default SuggestionPanel;
